webpackJsonp([0xf927f8900006],{329:function(e,n){e.exports={data:{markdownRemark:{html:"<p>I am a front-end/UX developer from Vancouver, BC.</p>\n<p>My work history spans multiple industries and job titles and I see my varied experience as a benefit when designing for end users.</p>\n<p>I studied Psychology and Linguistics at SFU and learning about human behaviour has given me invaluable insights, along with the research and interviewing skills, which I use throughout my design process.</p>\n<p>When I’m not working on these side projects I enjoy learning the guitar, discovering new Celiac friendly restaurants, and playing with my adopted rabbit Aria.</p>\n<h4>Education</h4>\n<ul>\n<li>Brainstation, User Experience and User Interface Design</li>\n<li>Simon Fraser University, B.A. Psychology</li>\n<li>Simon Fraser University, Certificate of Liberal Arts</li>\n</ul>\n<h2>Get in touch!</h2>\n<p>Whether it’s feedback on one of my projects or an idea you want to collaborate on, I would love to hear from you!</p>\n<p>Send me an email if you are interested in what I do, and we can arrange a time to chat.</p>\n<p>You can find me also on:</p>",frontmatter:{date:null,path:"/about",title:"About Me",tags:""}}},pathContext:{}}}});
